The quality is actually really great. If you need the full experience of the film, then wait for the theatrical version. There are green screens and wires attached to actors and so on still visible in this workprint. Some CGI is also incomplete, such as backgrounds and cgi models, but it's only in a few scenes. There are no missing scenes though which is great. In any case this is a super early release.
